import React from "react";
import f from "./ContactsForm.module.css"
import {Field, Form, Formik} from "formik";

export const AddContactsForm = ({addContactSubmit}) => {
    const submit = (values, {setSubmitting}) => {
        addContactSubmit(values)
        setSubmitting(false)
    }
    return (
        <div className={f.addContactsForm}>
            <Formik
                initialValues={{name: '',
                                email: '',
                                phoneNumber: '',
                                position: ''
                }}
                validate={addContactFormValidate}
                onSubmit={submit}
            >
                {({ isSubmitting }) => (
                    <Form>
                        <Field type="text" name="name" />
                        <Field type="email" name="email" />
                        <Field type="email" name="email" />
                        <button type="submit" disabled={isSubmitting}>
                            Add contact
                        </button>
                    </Form>
                )}
            </Formik>
        </div>
    )
}

const addContactFormValidate = (values) => {
    const errors = {}
    return errors
}
